<style>
  .banner-container{
    height:auto;
    overflow-y: hidden;
    margin: 25px 0;
  }
  .columns{
    margin: auto;
  }
  .logo-left-column{
    height:200px;
    text-align:right;
    transform: translateX(-200px);
    opacity: 0;
    transition: all 1s;
  }
  .logo-right-column{
    height:200px;
    transform: translateX(200px);
    opacity: 0;
    transition: all 1s;
  }
  .logo-down-column{
    height:80px;
    text-align:center;
    transform: translateY(100px);
    opacity: 0;
    transition: all 1s;
  }
  .move {
    opacity: 1;
    transform: translate(0);
  }
  img{
    height: 100%;
    width: auto;
  }
  .info-container{
    color:#484848;
    line-height: 35px;
  }
  .info-container .column{
    padding-left:24px;
    padding-right:24px;
  }
  .svg-main-container{
    overflow: hidden;
  }
  .svg-container{ 
    padding-top:5vh;
    overflow-x: hidden;
    transform:translateY(6px);
  }
  
  #mano-izq {
    animation: izq alternate 1s infinite;
    transform-origin: center;
    transform-box: fill-box;
  }
  #mano-der {
    animation: der alternate 1s infinite;
    transform-origin: center;
    transform-box: fill-box;
  }
  @keyframes izq {
    from {
      transform: rotateY(0deg);
    }
    to {
      transform: rotateY(25deg);
    }
  }
  @keyframes der {
    from {
      transform: rotateY(0deg);
    }
    to {
      transform: rotateY(-35deg);
    }
  }
  @media (max-width:1024px){
    .logo-left-column {
      height: 170px;
    }
    .logo-right-column {
      height: 170px;
    }
  }
  @media (max-width: 768px) {
    .logo-left-column {
      height: 100px;
      padding: 0;
      text-align: center;
    }
    .logo-right-column {
      height: 100px;
      padding: 0;
      text-align: center;
    }
    .logo-down-column{
      height: 60px;
      padding: 12px 0;
    }
    .info-container{
      line-height: 30px;
    }
    svg{
    transform: translateX(-40vw);
    }
  }
</style>